import { VStack, Sta } from "@chakra-ui/react";
import React from "react";
function TodoList() {
  
  
  return (
    <>
      <VStack
        divider={<StackDivider />}
        borderWidth="2px"
        borderColor="gray.100"
        borderRadius="lg"
        padding="4"
        width="100%"
        maxW={{ base: "90vw", sm: "90vw", lg: "50vw", xl: "40vw" }}
        alignItems={"stretch"}
      ></VStack>
    </>
  );
}

export default TodoList;
